import logo from './images/amazon-logo.png';
import './App.css';
import styleClasses from './smartwatch.module.css'

function App() {
  return (
    <div className="App">
      <header className="styleClasses.header">
        <nav>
          <img src={logo} alt="logo"/>
        </nav>

      </header>
    </div>
  );
}

export default App;
